import (
	context "context"
	fern "github.com/nullable/fern"
	fernclient "github.com/nullable/fern/client"
)

client := fernclient.NewClient()
response, err := client.Nullable.DeleteUser(
	context.TODO(),
	&fern.DeleteUserRequest{
		Username: fern.String(
			"xy",
		),
	},
)

import (
	context "context"
	fern "github.com/nullable/fern"
	fernclient "github.com/nullable/fern/client"
)

client := fernclient.NewClient()
response, err := client.Nullable.GetUsers(
	context.TODO(),
	&fern.GetUsersRequest{
		Usernames: []*string{
			fern.String(
				"usernames",
			),
		},
		Avatar: fern.String(
			"avatar",
		),
		Activated: []*bool{
			fern.Bool(
				true,
			),
		},
		Tags: []**string{
			fern.String(
				"tags",
			),
		},
		Extra: fern.Bool(
			true,
		),
	},
)

